Mbali Auto amatha kuumba Zitha kugawidwa m'magulu osiyanasiyana kutengera zida zawo, mawonekedwe, kapangidwe kake ndi kagwiritsidwe ntchito:
Malinga ndi zinthu zosiyanasiyana zogulitsa, zitha kugawidwa PC mbali zamagalimoto nkhungu, PP kusuntha kwamagalimoto nkhungu, ABS mbali galimoto nkhungu, ndi zina;
Malinga ndi mitundu yosiyanasiyana yazinthu, imatha kugawidwa Bampala nkhungu, Galimoto yapakati yolamulira, Armbokosi lopumulira nkhungu, Galimoto nkhungu nyali, Grille nkhungu, ndi zina;
Malinga ndi mitundu yosiyanasiyana yazogulitsa, itha kugawidwa Gwotayika mbali zamagalimoto nkhungu, Magalimoto azikopa nkhungu, Fkukhazikika mbali zamagalimoto nkhungu, ndi zina;
Malinga ndi zochitika zosiyanasiyana zogwiritsira ntchito, zitha kugawidwa Galimoto mbali nkhungu, magawo forklift mould, mathirakitala mbali nkhungus, zidole zamagalimoto mould, etc.
Heya Nkhungu tikunena kupanga ndi chitukuko cha amatha kuumba mbali galimoto, ndipo amaganizira kusankha ndi malo a mbali galimoto nkhungu zitsulo, dongosolo kuzirala, kutsanzikana mzere, makulidwe khoma, venting, etc. olandiridwa kuti alankhule nafe kuti mumve zambiri.
